import { Button, Flex, HStack, Text } from "@chakra-ui/react";
import React from "react";

const Index = () => {
  return (
    <HStack w="100%">
      <Flex
        w="100%"
        justifyContent="space-between"
        alignItems="center"
        py="1rem"
        bg="primary"
      >
        <Text>Wan't to know more about me?</Text>
        <Button>Reach me</Button>
      </Flex>
    </HStack>
  );
};

export default Index;
